import {GET_USER_INTERACTIONS } from "../constants/actionTypes";
// import { push } from "connected-react-router";
const API = `http://localhost:3000/api/v1`;

export function userInteractions() {
  return dispatch => {
    debugger
    return fetch(`${API}/current_interactions`,
      {
        method: "GET",
        headers: {
          Authorization: `Bearer ${localStorage.getItem("token")}`
        }
      }
    )
      .then(r => r.json())
      .then(res => dispatch({ type: GET_USER_INTERACTIONS, payload: res}))
  };
}


export function getUserInteractions () {
  return dispatch => {
    return fetch(`${API}/current_interactions`, headers)
    .then(r => r.json())
    .then(res => {
      // debugger
      dispatch({ type: GET_USER_INTERACTIONS, payload: res})
    })
  }
};
